import React from "react";
import styled from "styled-components";
import Bookmark from "./Bookmark";

const BookmarksList = () => {
  return (
    <Wrapper>
      <Bookmark title="MDN Documents" />
    </Wrapper>
  );
};

const Wrapper = styled.ul`
  width: 100%;
  height: 100%;
  position: relative;
  padding: 50px 10px;
`;

export default BookmarksList;
